class Point
{
	private:
		double m_x;
		double m_y;
	
	public:
		Point(double x = 0, double y = 0);
		double getX() const;
		double getY() const;
		void setX(double x);
		void setY(double y);
}

Point::Point(double x = 0, double y = 0) : m_x(x), m_y(y)
{
}

double Point::getX() const
{
	return m_x;
}

double Point::getY() const
{
	return m_y;
}

void Point::setX(double x)
{
	m_x = x;
}

void Point::setY(double y)
{
	m_y = y;
}

class Drawable
{
	private:
		Point m_p;
	
	public:
		virtual void draw() = 0;
		virtual void move(double dx, double dy) = 0;
}

void Drawable::draw()
{
	print(m_p.getX(), m_p.getY());
}

void Drawable::move(double dx, double dy)
{
	m_p.setX(m_p.getX() + dx);
	m_p.setY(m_p.getY() + dy);
}



class Circle : public Drawable
{
	private:
		double m_radius;
	public:
		Circle(Point p, double radius);
		void draw();
		void move(double dx, double dy);
	
}

Circle::Circle(Point p, double radius) : m_p(p), m_radius(radius)
{
}

class Triangle : public Drawable
{
	private:
		double m_base;
		double m_height;
	public:
		Triangle(Point p, double base, double height);
		void draw();
		void move(double dx, double dy);
}

Triangle::Triangle(Point p, double base, double height) : m_p(p), m_base(base), m_height(height)
{
}

class Polygon : public Drawable
{
	private:
		int m_sides ;
		double m_length;
	public:
		Polygon(Point p, int sides, double length);
		void draw();
		void move(double dx, double dy);
}

Polygon::Polygon(Point p, int sides, double length) : m_p(p), m_sides(sides), m_length(length)
{
}

