"use strict";
(function(window,document){
	window.onload = function(){

		function showInfo(e) {
			e.preventDefault();
			var pointer = this;
			var alt = pointer.alt;

			var xhr = new XMLHttpRequest();
			xhr.open("GET","lib/data/aufgabe2_data.json", true);
			xhr.onreadystatechange = function() {
				if(xhr.readyState === 4 && xhr.status === 200) {
					var data = JSON.parse(xhr.responseText);
					var html = "";
					for(var i = 0; i < data.length; i++) {
						if(data[i].alt == alt) {
							html += '<img src="lib/img/magic/preview/' + data[i].src + '" alt="' + data[i].name;
							html += "<ul>";
							html += "<li><h2>" + data[i].name + "</h2></li>";
							html += "<li>" + data[i].nr + "</li>";
							html += "<li>" + data[i].color + "</li>";
							html += "<li>" + data[i].rare + "</li>";
							html += "<li>" + data[i].ed + "</li>";
							html += "<li>" + data[i].state + "</li>";
							html += "</ul>";
						}
					}
				} 
				document.getElementById("infotext").innerHTML = html;
			};
			xhr.send();
		}

		var aufgabe2 = document.getElementById("main").getElementsByTagName("ul")[0].getElementsByTagName("img");
		for (var i = 0; i < aufgabe2.length; i++) {
			aufgabe2[i].onclick = showInfo;
		}
	};
} (window,document) );
